    false,nt"url": null,nt"notes": "An aerial photograph is a photograph of
    the earth's surface taken with a camera mounted in an airplane. The geographic extent
    of this scanned, georectified, and mosaiced 1.5-meter pixel resolution black and
    white digital aerial photograph is approximately the Treasure Valley in Idaho. 42
    tiles acquired as part of the 1939 Treasure Valley Air Photo Project are included
    in this mosaic. The collection area includes almost all of Canyon county, portions
    of the north-western half of Ada county, the southern tip of Payette county, and
    a small portion of the south-western tip of Gem county. The 1:20,000-scale black
    and white aerial photography used in the production of this mosaiced image was flown
    in the summer and winter of 1938 and 1939 by the USDA Soil Conservation Service.",nt"license_title":
